import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import DrawerMainTable from './DrawerMainTable';
import { useQuery } from 'react-query';
import { useState } from 'react';
import { Button, Divider } from '@mui/material';
import DrawerBtcTable from './DrawerBtcTable';

type DessertDetail = {
  name: string,
  calories: number,
  fat: number,
  carbs: number,
  protein: number
}

export type PriceType = {
  code: string,
  symbol: string,
  rate: string,
  description: string,
  rate_float: string
}

const getPriceBTC = async () => {
  const res = await fetch('https://api.coindesk.com/v1/bpi/currentprice.json');
  return res.json();
};

const PRICE_BTC = "priceBTC"

const MainTable = () => {
  const [dataMainDrawer, setDataMainDrawer] = useState<DessertDetail | null>(null)
  const [dataBtcDrawer, setDataBtcDrawer] = useState<DessertDetail | null>(null)
  const query = useQuery(PRICE_BTC, getPriceBTC)

  const [dessetData, setDessertData] = useState<Array<DessertDetail>>([
    { name:'Frozen yoghurt', calories: 159, fat: 6.0, carbs: 24, protein: 4.0 },
    { name:'Ice cream sandwich', calories: 237, fat: 9.0, carbs: 37, protein: 4.3 },
    { name:'Eclair', calories: 262, fat: 16.0, carbs: 24, protein: 6.0 },
    { name:'Cupcake', calories: 305, fat: 3.7, carbs: 67, protein: 4.3 },
    { name:'Gingerbread', calories: 356, fat: 16.0, carbs: 49, protein: 3.9 },
  ]);
  const [btcPrice, setBtcPrice] = useState<PriceType[]>([query.data.bpi.USD, query.data.bpi.GBP, query.data.bpi.EUR])

  if (!query.data) return <></>

  // const btcPrice: PriceType[] = [query.data.bpi.USD, query.data.bpi.GBP, query.data.bpi.EUR] 

  return (
    <>
      <h2 className="text-xl text-gray-500 font-bold pt-4">
        Dessert 
      </h2>
      <div className='rounded-lg overflow-hidden shadow-light-300 shadow-lg'>
        <TableContainer component={Paper} >
          <Table sx={{ minWidth: 650 }} aria-label="simple table">
            <TableHead style={{backgroundColor: "#EFF6F6"}}>
              <TableRow>
                <TableCell>Dessert (100g serving)</TableCell>
                <TableCell align="left">Calories</TableCell>
                <TableCell align="left">Fat&nbsp;(g)</TableCell>
                <TableCell align="left">Carbs&nbsp;(g)</TableCell>
                <TableCell align="left">Protein&nbsp;(g)</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {dessetData.map((row) => (
                <TableRow 
                  onClick={() => {setDataMainDrawer(row)}}
                  key={row.name}
                  className='hover:cursor-pointer hover:bg-gray-100'
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell align="left">{row.calories}</TableCell>
                  <TableCell align="left">{row.fat}</TableCell>
                  <TableCell align="left">{row.carbs}</TableCell>
                  <TableCell align="left">{row.protein}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </div>
      <div className='py-4'>
        <Divider />
      </div>
      <div className='flex flex-row justify-between items-center'>
        <h2 className="text-xl text-gray-500 font-bold">
          BTC Price 
        </h2>
        <Button
          variant='contained'
          onClick={() => {
          query.refetch()
        }}>
          Refresh
        </Button>
      </div>
      <div className='rounded-lg overflow-hidden shadow-light-300 shadow-lg'>
        <TableContainer component={Paper} >
          <Table sx={{ minWidth: 650 }} aria-label="simple table">
            <TableHead style={{backgroundColor: "#EFF6F6"}}>
              <TableRow>
                <TableCell>Code</TableCell>
                <TableCell align="left">Symbol</TableCell>
                <TableCell align="left">Rate</TableCell>
                <TableCell align="left">Description</TableCell>
                <TableCell align="left">Rate Float</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {btcPrice.map((row) => (
                <TableRow 
                  // onClick={() => {setDataDrawer(row)}}
                  key={row.code}
                  className='hover:cursor-pointer hover:bg-gray-100'
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell component="th" scope="row">
                    {row.code}
                  </TableCell>
                  <TableCell align="left">{row.symbol}</TableCell>
                  <TableCell align="left">{row.rate}</TableCell>
                  <TableCell align="left">{row.description}</TableCell>
                  <TableCell align="left">{row.rate_float}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </div>
      {
        dataMainDrawer &&
        <DrawerMainTable
          data={dataMainDrawer}
          onClose={() => {setDataMainDrawer(null)}}
          saveForm={setDessertData}
        />
      }
      {
        dataBtcDrawer &&
        <DrawerBtcTable
          data={dataBtcDrawer}
          onClose={() => {setDataBtcDrawer(null)}}
          saveForm={setBtcPrice}
        />
      }
    </>
  );
}

export default MainTable
